const colors = [
    "red",     // 1
    "blue",    // 2
    "green",   // 3
    "yellow",  // 4
    "teal",    // 5
    "purple",  // 6
    "pink",    // 7
    "orange",  // 8
    "white",   // 9
];
const sequence = [1, 2, 8, 7].map((key) => key - 1);
let currentSequence = [];

colors.map((color, i) => {
    console.log("SETUP", color, i);
    const feature = parcel.getFeatureById(`pad-${color}`);
    feature.on("click", () => {
        addSequence(i);
        console.log("click", colors[i]);
    });
});
parcel.getFeatureById("check-open").on("click", () => checkOpen());

function addSequence(index) {
    currentSequence.push(index);
    while (currentSequence.length > sequence.length) {
        currentSequence.shift();
    }

    console.log(currentSequence);
}

function checkOpen() {
    if (currentSequence.join(" ") !== sequence.join(" ")) {
        console.log("LOCKED", currentSequence.join(" "), sequence.join(" "));
        currentSequence = [];
        return;
    }

    parcel.getFeatureById("block").set({ "collidable" : false });

    console.log("UNLOCKED");
    currentSequence = [];
}

console.log("KEY PAD ENABLED");

const FPS_24 = (1 / 24) * 1000;
const ROT_SPEED = 5 / 180;
const cube = parcel.getFeatureById("rot-cube");
function rotateTick() {
    cube.rotation.y += ROT_SPEED;
    setTimeout((360) => {
        requestAnimationFrame(rotateTick);
    }, FPS_24);
}
